text380778.addInnerText('<div id=\"text380778\" aria-live=\"polite\" ><a id=\"text380778anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text380778Font2\" data-bltIndnt=\"0\" style=\"line-height:1.107;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text380778CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text380778Font2\"  >A file census is a formal inspection of classified holdings where files have their documents checked against the folio sheet and the CDR. It is coordinated or conducted by the </span ><span class=\"text380778Font3\"  >Security Officer.&nbsp;</span ><span class=\"text380778Font2\" style=\"background-color:transparent\" >\n</span ></li >\n</ul >\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text380778Font2\" style=\"position:relative;top:-1px;\" >â€‹</span ><span class=\"text380778Font5\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text380778Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text380778CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text380778Font2\"  >A file census of all information classified SECRET, TOP SECRET and accountable material is to occur at least </span ><span class=\"text380778Font6\"  >every two years.</span ><span class=\"text380778Font2\"  > Areas with existing CONFIDENTIAL material must be part of the census. \n</span ></li >\n</ul >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text380778Font2\" style=\"position:relative;top:-1px;\" >â€‹</span ><span class=\"text380778Font5\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text380778Font2\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text380778CircleBulletFont7.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text380778Font2\"  >Missing documents are a security incident and must be reported as soon as possible. Speak to your Security Officer for advice. \n</span ></li >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
